import React, { Component } from "react";

class Portfolio extends Component{
    render(){
        return(
            <div>
                <p>Portfolio</p>
                <h2>{this.props.title}</h2>
                <img src={this.props.image} alt={this.props.alt}/>
                <p>{this.props.text}</p>
            </div>
        )
    }
}

export default Portfolio
